We have a Priyanka Sr. QA Analyst. She is having 7+ Yrs. Exp. She is in San Jose,CA. She is looking for the Project in San Jose, SFO Only. She is available for Project Immediately. 
 
Summary:
 
Over 7 years of professional experience in Information Technology with extensive skills in Software Testing, Integration Testing, Functional Testing, Regression Testing, System Testing, Performance Testing, Software Design, Development, and Quality 
Analysis. 
Extensive experience in the entire application Software Development Life Cycle(SDLC), which includes Requirements, Design, Development, System Testing, Configuration, Installation, Release Authorization, and Maintenance Phases. 
Experience in the field of Insurance, Banking Financial Domain & Shipping and Tracking. 
Experience in analyzing Business Requirements and Specifications. Worked with Development and Business Analysts to define, write and execute test cases. 
Experience in Testing Methodology and Test Plan Formulation. 
Complete understanding of QA methodologies. Expertise and experience in performing different kinds of testing like black box testing, functional testing, GUI testing, integration testing, Back-end Testing, performance testing, System Testing, 
regression testing and bug tracking system. 
Experience in testing Web, Client/Server and Stand-alone Windows applications. 
Extensive experience in writing Test plans, Test cases/scenarios, Test procedures and analyzing test results for manual and automated tests. 
Extensive experience in manual testing in various environments and using automated testing tools of HP (formerly Mercury interactive) Quick Test Professional (QTP), Load Runner, Quality Center, Cert and Clear Quest. 
Expertise in problem solving and Bug Reports using Quality Center, Clear Quest. 
Strong experience in client interaction and understanding business application and data relations from Product development group. 
Experience in Manual and Automated testing, test schedule planning, test case design, Documentation and Execution. Editing and playback the scripts after fixing the bug. 
Good exposure to RDBMS, SQL and PL/SQL, writing SQL scripts for backend/database testing. 
Extensively involved in Back-end Testing and manual testing using SQL and PL/SQL statements for data manipulation 
Good communication, analytical skills and flexible to learn advancements in the IT industry. Capable of performing multi-tasking and meets deadlines. 
Education 
Bachelor of Engineering in JNTU University.
